/* eslint-disable react-native/no-inline-styles */
import AsyncStorage from '@react-native-async-storage/async-storage';
import React, {useEffect, useState} from 'react';
import {View, StyleSheet, Text, Image, ImageBackground} from 'react-native';

const HomeProfile = () => {
  const [USER_NAME, setUSER_NAME] = useState('Buddy!');
  const extractLocalData = async key => {
    const response = await AsyncStorage.getItem('USERNAME');
    if (response !== null) {
      setUSER_NAME(response.split(' ')[0]);
    }
  };
  useEffect(() => {
    extractLocalData();
  }, []);
  return (
    <ImageBackground
      style={[{width: '100%', height: '50%'}, styles.backgroundImage]}
      source={require('../images/wave.png')}>
      <View style={styles.container}>
        <Image
          style={[
            styles.profileImage,
            {
              width: 51,
              height: 51,
              resizeMode: 'contain',
            },
          ]}
          source={{
            uri: 'data:image/jpeg;base64,',
          }}
        />
        <Text style={styles.welcomeUser}>Hi, {USER_NAME}!</Text>
      </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  container: {
    justifyContent: 'space-between',
    flexDirection: 'row',
    padding: 10,
  },
  welcomeUser: {
    color: '#ffff',
    textAlignVertical: 'center',
    textAlign: 'center',
    fontSize: 20,
    fontWeight: 'bold',
    flex: 1,
  },
  profileImage: {
    borderRadius: 50,
    borderColor: '#53C5F6',
    borderWidth: 2,
  },
  backgroundImage: {
    height: 100,
  },
});

export default HomeProfile;
